    const [concluidos,setconcluidos]= useState(0);
    function recebeContador(){
        setconcluidos(concluidos+1)
    }


    return (
        <Wrapper>
            <GlobalStyle/>
            <Header/>
            <Margem>
            <Perguntas/>
